                  key={Navigation.DECRYPT}
                  style={{}}
                >
                  <Link to={Navigation.DECRYPT}>
                    Decrypt
                  </Link>
                </Menu.Item>

              </Menu>
            </Layout.Sider>
          </Layout>
      </div>
    </>
  );
}

